C.WA=new L.z("Flexfold is a smooth responsive scaffold package for Flutter. This application demonstrates its core features.\n\nThe Flexfold responsive navigation automatically changes from bottom bar, to rail and to side menu as the canvas size grows. The smooth part is that the switches from one mode to another, are animated.\n\nOn a large canvas you can change the side menu from being hidden, to a rail and to be visible as a locked side menu. You do this by clicking on the menu button, the menu button determines based on canvas size and defined breakpoints which modes it can use and only switches between them.\n",null,null,null,null,null,null,null,null)
